import hotel from "..src/images/hotel.jfif";
import flight from "..src/images/flight.jfif";
import restaurant from "..src/images/restaurant.jfif";
import maldives from "..src/images/maldives.jpg";
import tovisit from "..src/images/tovisitplaces.jpg";
import guidance from "..src/images/guidance.jfif";

const data =[
    {
        imgsrc: hotel,
        title: "Hotel Booking",
    },
    {
        imgsrc: flight,
        title: "Flight Booking",
    },
    {
        imgsrc: restaurant,
        title: "Popular Reastaurant",
    },
    {
        imgsrc: maldives,
        title: "Good Travel Experience",
    },
    {
        imgsrc: tovisit,
        title: "To Visit Places",
    },
    {
        imgsrc: guidance,
        title: "Travel Guidance",
    },
];

export default data;
